import { SHOP_ITEMS } from './shop.types';

const INITIAL_STATE = {
  items: SHOP_ITEMS
};

export const shopReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};


export default shopReducer;
